static int
format_decoder (const xtensa_insnbuf insn)
{
  if ((insn[0] & 0x8) == 0 && (insn[1] & 0) == 0)
    return 0; /* x24 */
  if ((insn[0] & 0xc) == 0x8 && (insn[1] & 0) == 0)
    return 1; /* x16a */
  if ((insn[0] & 0xe) == 0xc && (insn[1] & 0) == 0)
    return 2; /* x16b */
  if ((insn[0] & 0xf) == 0xf && (insn[1] & 0) == 0)
    return 3; /* ae_format */
  if ((insn[0] & 0xf) == 0xe && (insn[1] & 0x80000000) == 0x80000000)
    return 4; /* ae_format1 */
  if ((insn[0] & 0xf) == 0xe && (insn[1] & 0xf0000000) == 0)
    return 5; /* ae_format2 */
  if ((insn[0] & 0xf) == 0xe && (insn[1] & 0xfffffe00) == 0x40000000)
    return 6; /* ae_mini0 */
  if ((insn[0] & 0xf) == 0xe && (insn[1] & 0xa0000000) == 0x20000000)
    return 7; /* xt_format1 */
  if ((insn[0] & 0xf) == 0xe && (insn[1] & 0xff000000) == 0x10000000)
    return 8; /* xt_format2 */
  return -1;
}

